// frontend/src/components/DiabetesForm.js
import React, { useState } from 'react';
import axios from 'axios';

const fields = [
  { id: 'Pregnancies', label: 'Pregnancies', icon: 'ü§∞', min: 0, max: 20, step: 1 },
  { id: 'Glucose', label: 'Glucose (mg/dL)', icon: 'ü©∏', min: 0, max: 300, step: 1 },
  { id: 'BloodPressure', label: 'Blood Pressure (mmHg)', icon: '‚ù§Ô∏è', min: 0, max: 200, step: 1 },
  { id: 'SkinThickness', label: 'Skin Thickness (mm)', icon: 'üìè', min: 0, max: 100, step: 1 },
  { id: 'Insulin', label: 'Insulin (ŒºU/mL)', icon: 'üíâ', min: 0, max: 900, step: 1 },
  { id: 'BMI', label: 'BMI', icon: '‚öñÔ∏è', min: 0, max: 70, step: 0.1 },
  { id: 'DiabetesPedigreeFunction', label: 'Diabetes Pedigree', icon: 'üß¨', min: 0, max: 2.5, step: 0.001 },
  { id: 'Age', label: 'Age', icon: 'üéÇ', min: 0, max: 120, step: 1 },
];

export default function DiabetesForm() {
  const [form, setForm] = useState({});
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleChange = e => {
    setForm({ ...form, [e.target.name]: Number(e.target.value) });
  };

  const handleSubmit = async e => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    setResult(null);

    try {
      const resp = await axios.post(
        `${process.env.REACT_APP_API_URL || 'http://localhost:5000'}/predict`,
        form
      );

      const { prediction } = resp.data;
      const feedback =
        prediction === 'Diabetic'
          ? 'High risk detected. Please consult a healthcare professional immediately.'
          : 'Low risk. Continue maintaining a healthy lifestyle!';

      setResult({ prediction, feedback });
    } catch (err) {
      setError(
        err.response?.data?.error ||
        err.message ||
        'Connection failed. Is the server running?'
      );
    } finally {
      setLoading(false);
    }
  };

  const handleReset = () => {
    setForm({});
    setResult(null);
    setError(null);
  };

  return (
    <>
      <div className="header">
        <div className="stethoscope">ü©∫</div>
        <h1>Diabetes Risk Predictor</h1>
        <p style={{ margin: '8px 0 0', fontSize: '0.95rem', opacity: 0.9 }}>
          AI-Powered Health Screening Tool
        </p>
      </div>

      <div className="form-container">
        <form onSubmit={handleSubmit} className="form-grid">
          {fields.map(f => (
            <div className="input-group" key={f.id}>
              <label>
                <span className="icon">{f.icon}</span> {f.label}
              </label>
              <input
                type="number"
                name={f.id}
                min={f.min}
                max={f.max}
                step={f.step}
                required
                onChange={handleChange}
                placeholder={`Enter ${f.label.toLowerCase()}`}
              />
            </div>
          ))}

          <div className="button-group">
            <button type="submit" disabled={loading} className="btn btn-primary">
              {loading ? (
                <>‚è≥ Predicting...</>
              ) : (
                <>üß† Predict Risk</>
              )}
            </button>
            <button type="button" onClick={handleReset} className="btn btn-secondary">
              üîÑ Reset
            </button>
          </div>
        </form>

        {(result || error || loading) && (
          <div
            className={`result ${
              result
                ? result.prediction === 'Diabetic'
                  ? 'diabetic'
                  : 'non-diabetic'
                : error
                ? 'error'
                : ''
            }`}
          >
            {loading && !result && !error && (
              <div className="loading">Analyzing your data...</div>
            )}
            {error && (
              <>
                <strong>‚ö†Ô∏è Error</strong>
                <br /><br />
                {error}
              </>
            )}
            {result && (
              <>
                <div style={{ fontSize: '1.5rem', marginBottom: '10px' }}>
                  {result.prediction === 'Diabetic' ? 'üî¥' : 'üü¢'} {result.prediction}
                </div>
                <div style={{ fontSize: '1rem', lineHeight: '1.5' }}>
                  {result.feedback}
                </div>
              </>
            )}
          </div>
        )}
      </div>
    </>
  );
}
